import classNames from "classnames/bind";

import styles from "./List.module.scss";
import { useEffect, useState } from "react";
import { getResult } from "../../../../Services/result";

const cx = classNames.bind(styles)

function ListResult() {

    const [data, SetData] = useState();

    const getAPI = async () => {
        try {
            const resultData = await getResult()
            SetData(resultData.data);
        } catch (error) {
            console.log("error: ".error);
        }
    }

    getAPI();

    return (
        <section className={cx("warpper")}>
            <table className={cx("table")}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Degree</th>
                        <th>Date</th>
                        <th>School Name</th>
                        <th>Describe</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data.map((item, index) => {
                            <tr key={index}>
                                <td>`${item.Name}`</td>
                                <td>`${item.Degree}`</td>
                                <td>`${item.Date}`</td>
                                <td>`${item.School}` Name</td>
                                <td>`${item.Describe}`</td>
                                <td>
                                    <button className={cx("Delete")}>Delete</button>
                                    <button className={cx("Edit")}>Edit</button>
                                </td>
                            </tr>
                        })
                    }
                </tbody>
                
            </table>
        </section>
    )
}

export default ListResult;
